import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/">Inicio</Link>
        </li>
        <li>
          <Link to="/registro">Registro</Link> {/* Cambia la ruta a "/registro" */}
        </li>
        <li>
          <Link to="/login">Iniciar sesi√≥n</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
